import React from 'react';

/*
function App() {
    return (
    <div>
        <h1>Hello</h1>
    </div>
    )
}
*/

class App extends React.Component {

    mtMethod() {
        return 5;
    }

    render() {
        const data = new Date();
        return (
            <div>
                <h1>Time {data}</h1>
            </div>
        )
    }
}

export default App
